import React, { Component } from "react"
import tickIcon from "./img/checked.gif"
import {
  Body,
  Icon,
  Title,
  Text,
  Info,
  DoneButton,
} from "./styles/registerSuccessful"

class RegisterSuccessful extends Component {
  constructor(props) {
    super(props)
    this.state = {
      isShow: true,
    }
    this.handleClick = this.handleClick.bind(this)
  }

  handleClick() {
    this.setState({
      isShow: false,
    })
  }

  render() {
    const { isShow } = this.state
    return (
      <>
        {isShow ? (
          <Body>
            <Icon src={tickIcon} alt="success" />
            <Title>Registration Successful</Title>
            <Info>
              <Text>
                Hi Kyrie, Welcome to BestTraveller! This is a big family to help
                you find your ideal tour. Let us start the journey! ✈️
              </Text>
            </Info>
            <DoneButton onClick={this.handleClick}>Done</DoneButton>
          </Body>
        ) : null}
      </>
    )
  }
}

export default RegisterSuccessful
